import { useEffect, useState, useContext } from 'react';
import axios from 'axios';
import { CartContext } from '../context/CartContext';
import SearchBar from './SearchBar';
import Recommendations from './Recommendations';

function ProductList() {
  const [products, setProducts] = useState([]);
  const [selectedProduct, setSelectedProduct] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const { addToCart } = useContext(CartContext);

  useEffect(() => {
    setLoading(true);
    axios.get('http://localhost:5000/api/products')
      .then(res => {
        setProducts(res.data);
        setLoading(false);
        setError(null);
      })
      .catch(err => {
        console.error('Error fetching products:', err);
        setError('Failed to fetch products');
        setLoading(false);
      });
  }, []);

  const handleSearchResults = (results) => {
    setProducts(results);
    setSelectedProduct(null); // clear selection on search
  };

  const handleProductClick = (product) => {
    setSelectedProduct(product);
  };

  return (
    <div>
      <SearchBar onResults={handleSearchResults} />
      <h2>Recommendations</h2>
      <Recommendations />
      <hr />
      <h2>Product Catalog</h2>

      {loading && <p>Loading products...</p>}
      {error && <p style={{ color: 'red' }}>{error}</p>}
      {!loading && !error && products.length === 0 && <p>No products found.</p>}

      <div style={{ display: 'flex', flexWrap: 'wrap', gap: '20px' }}>
        {products.map(p => (
          <div
            key={p._id}
            style={{ border: '1px solid #ccc', padding: '10px', width: '200px', cursor: 'pointer' }}
            onClick={() => handleProductClick(p)}
          >
            <img src={p.image} alt={p.name} style={{ width: '100%' }} />
            <h4>{p.name}</h4>
            <p>${p.price.toFixed(2)}</p>
            <button onClick={(e) => {
              e.stopPropagation(); // prevent triggering product detail view
              addToCart(p);
            }}>
              Add to Cart
            </button>
          </div>
        ))}
      </div>

      {/* Detailed Product View */}
      {selectedProduct && (
        <div style={{ marginTop: '30px', padding: '20px', border: '2px solid #000' }}>
          <h3>Product Details</h3>
          <img src={selectedProduct.image} alt={selectedProduct.name} style={{ width: '200px' }} />
          <h4>{selectedProduct.name}</h4>
          <p><strong>Price:</strong> ${selectedProduct.price.toFixed(2)}</p>
          <p><strong>Brand:</strong> {selectedProduct.brand}</p>
          <p><strong>Category:</strong> {selectedProduct.category}</p>
          <p><strong>Subcategory:</strong> {selectedProduct.subcategory}</p>
          <p><strong>Description:</strong> {selectedProduct.description}</p>
          <p><strong>Stock:</strong> {selectedProduct.countInStock}</p>
          <button onClick={() => addToCart(selectedProduct)}>Add to Cart</button>
        </div>
      )}
    </div>
  );
}

export default ProductList;
